body:
@john-bodley @mistercrunch  the `lyftga` branch was a pragmatic choice for us to reduce surface area of code changes in order to commit to an internal GA date with confidence. This branch is supposed to be short-lived (like a feature branch). It is not meant to be a long-lived fork.

We did a soft GA release on 4/9 and found a few issues (mostly in the new features we added) we still need to address prior to our hard release date of 4/23. We plan to continue to check fixes to lyftga till EOD 4/23.

The plan is to take the payload to master after 4/23 and delete the lyftga branch. Does this sound reasonable? If so, we can discuss logistics for who/how/when to bring the payload to master?
